+    // complex_low
+    template<class A> batch<double, A> complex_low(batch<std::complex<double>, A> const& self, requires<avx2>) {
+            __m256d tmp0 = _mm256_permute4x64_pd(self.real(), _MM_SHUFFLE(3, 1, 1, 0));
