+    }
+
+    template<class A> batch<double, A> fnma(simd_register<double, A> const& x, simd_register<double, A> const& y, simd_register<double, A> const& z, requires<fma>) {
+      return _mm256_fnmadd_pd(x, y, z);
+    }
